// src/screens/Home.js
import React from 'react';
import homeStyles from '../styles/home.css';  // Importando os estilos

const Home = () => {
    return (
        <div className={homeStyles.body}>
          <header className={homeStyles.header}>
            <div className={homeStyles.logo}>
              <img src="caminho/para/seu/logo.png" alt="Logo do Sistema" />
            </div>
            <div className={homeStyles.headerLinks}>
              <a href="#" className={homeStyles.link}>Segurança de Dados</a>
              <a href="#" className={homeStyles.link}>Criar Perfil Gratuito</a>
            </div>
          </header>
          <main className={homeStyles.main}>
            {/* Conteúdo principal */}
            <div className={homeStyles.searchForm}>
              <input type="text" className={homeStyles.input} placeholder="Nome da Cidade" />
              <button className={homeStyles.button} onClick={() => handlePesquisar()}>Pesquisar</button>
            </div>
          </main>
        </div>
      );

      
    }
    const handlePesquisar = () => {
      // Lógica de pesquisa aqui
      console.log('Pesquisar...');
    };
    

export default Home;
